DIAGNOSIS: Males of 

O. communis

can be recognized by the large leaf-shaped setae on the diamond-shaped labium (
Figs. 120–123
), the group of strong, converging setae on distal part of the chelicerae, the palpal femur ventrally swollen at base (
Fig. 98, 100
) and the palpal cymbium rounded (
Fig. 99
). Females have leaf-shaped dorsolateral extensions in the genitalia (
Fig. 104
, Ex) and the sclerotized parts (AUS + Pr) appear x-shaped through the cuticle (
Fig. 102
).
